import React from 'react';
import CarouselImage from '../img/landing_page.png';
import Arrow from '../img/arrow-dropdown.png';
const LandingCarousel = () => {
	return (
		<div>
			{/* BEGINNING OF CAROUSEL CARDS CODE */}
			<section id="carousel-section">
				<div id="card-carousel-container">
					<div id="inner-carousel-container">
						<div id="card-carousel-left" className="carousel-btn">
							<button type="button" id="card-carousel-left-btn" className="btn">
								<img
									className="carousel-btn-img"
									style={{ transform: 'rotate(-90deg)' }}
									src={Arrow}
									alt="carousel arrow"
								/>
							</button>
						</div>

						<div id="card-carousel" className="landing-carousel"></div>

						<div id="card-carousel-right" className="carousel-btn">
							<button
								type="button"
								id="card-carousel-right-btn"
								className="btn"
							>
								<img
									className="carousel-btn-img"
									style={{ transform: 'rotate(90deg)' }}
									src={Arrow}
									alt="carousel arrow"
								/>
							</button>
						</div>
					</div>
					<img id="carousel-img" src={CarouselImage} />
				</div>
			</section>
			{/* END OF CAROUSEL CARDS CODE */}
		</div>
	);
};

export default LandingCarousel;
